  \"grayscale-shaded-relief-of-idaho-with-a-horizontal-grid-spacing-of-30-meters\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The 30-meter Grayscale Shaded Relief of
  Idaho data set was derived from the 1 arc second National Elevation Dataset and
  USGS DEM elevation data. The NED is a seamless mosaic of best-available elevation
  data. The 7.5-minute elevation data for the conterminous United States are the primary
  initial source data. In addition to the availability of complete 7.5-minute data,
  efficient processing methods were developed to filter production artifacts in the
  existing data, convert to the NAD83 datum, edge-match, and fill slivers of missing
  data at quadrangle seams. One of the effects of the NED processing steps is a much-improved
  base of elevation data for calculating slope and hydrologic derivatives. The specifications
  for the NED 1 arc second and 1/3 arc second data are: Geographic coordinate system
  Horizontal datum of NAD83, except for AK which is NAD27 Vertical datum of NAVD88,
  except for AK which is NAVD29 Z units of meters.\",\n\t\"license_title\": null,\n\t\"extras\":
